    effect: createCommonRequestFx<FaqRequest | void, FaqItemResponse>((params) => ({
        url: API.faq.list,
        params: {
            post_type: 'faq',
            ...params,
        },
    })),
    initialData: {} as FaqItemResponse,
});

cache(getFAQQuery);

